// src/App.js
import React from 'react';
import { hitungLuasPersegiPanjang, cekAngkaGenapGanjil } from './utils';

function App() {
  const luas = hitungLuasPersegiPanjang(5, 3); // Contoh pemanggilan fungsi hitungLuasPersegiPanjang
  const angka = 7;
  const jenisAngka = cekAngkaGenapGanjil(angka); // Contoh pemanggilan fungsi cekAngkaGenapGanjil

  return (
    <div>
      <h1>Contoh Penggunaan Fungsi dalam React</h1>
      <p>Luas Persegi Panjang: {luas}</p>
      <p>Jenis Angka {angka}: {jenisAngka}</p>
    </div>
  );
}

export default App;
